    "2013-03-15T22:24:43.541210",nt"name": "florida-well-log-observation-data",nt"isopen":
    false,nt"url": null,nt"notes": "These data contain basic information describing
    well log provided by the Florida Geological Survey, published as a downloadable
    file, ESRI Service, Web Map service, and as a Web Feature service for the National
    Geothermal Data System. The downloadable documents contain 7 worksheets, including
    information about the template, notes related to revisions of the template, resource
    provider information, the data, a field list (data mapping view) and a worksheet
    with vocabularies for use in populating the spreadsheet (data valid terms). Fields
    in the data table include Well Name, API Number, Ended Drilling Date, Well Type,
    Bottom Logged Interval, and Log Notes.",nt"license_title": null,nt"extras":
